module.exports = function (graph, agents, relationships) {
  graph.beginUpdate()
  each(agents, (agent, i) => {
    // agentIdToIndex.set(agent.id, i)
    graph.addNode(agent.id, agent)
  })

  each(relationships, (relationship, i) => {
    graph.addLink(relationship.source, relationship.target, relationship)
  })
  graph.endUpdate()
}
